import React from "react";

class SelectRate extends React.Component {


    render() {
        let currencyList = this.props.currencies;
        return (
                <table className='currencyTable'>
                    <tbody>
                    <tr>
                        <th>Currency</th>
                        <th>NBU course</th>
                    </tr>
                    {
                      currencyList.map(elem=>{
                        return (<tr>
                            <td >{elem.cc}</td> 
                            <td>{elem.rate}</td> 
                            </tr>)
                          })
                    }
                    </tbody>

                </table>
        );
    }
}

export default SelectRate;
